import { Container } from 'react-bootstrap';
import './test.css';

function Test(){

    let Returner = (x, exponent = 2) => {
        return x ** exponent;
    }

    return(
        <Container fluid>
            <div className = "container">
                <h1>Сообщение: {Returner(23)}</h1>
                <button className = "button" onClick={() => {
                    alert('Hi')
                }}>
                    Нажми на меня
                </button>
            </div>
        </Container>
    )
}

export default Test
